import { NOMBRETIENDA } from "../CONST";

const Producto = function () {
	const imagen = "https://clickzapatilla.cl/imagenes/productos/nike/airvapormaxtnplus/202209141351/30731578.jpg";
	return(
		<section className="producto">
			<img src={imagen} alt="" />
			<p>Nombre</p>
		</section>
	)
};

function Grilla() {
	return (
		<section id="grilla">
			<Producto />
		</section>
	)
}
export default Grilla;
